import React from 'react';

class ProductItems extends React.Component{
    constructor(props){
        super(props);

        this.state = {
           items:{
               id: '001',
               name:'samsung watch',
               qty:4,
               price:5000
           }
        }
    }

    render(){
        return(<div>
            <pre>{JSON.stringify()}</pre>
            <table className="table table-hover text-center table-striped table-warning mt-3">
              <thead className="bg-dark text-white">
                  <th>Item Id</th>
                  <th>Item Name</th>
                  <th>Item Quentity</th>
                  <th>Item Price</th>
                  <th>Item Total Price</th>
              </thead>
              <tbody>
                 <tr>
                    <td>{this.state.items.id}</td>
                    <td>{this.state.items.name}</td>
                    <td>
                    <i className="fa fa-minus-circle text-primary mr-2"></i> 
                        {this.state.items.qty} 
                        <i className="fa fa-plus-circle text-primary ml-2"></i>    
                    </td>

                    <td>{this.state.items.price}</td>
                    <td>{'total'}</td>
                 </tr>
              </tbody>
            </table>
        </div>);
    }
}

export default ProductItems;
